import axios from 'axios'

export const register = newUser => {
  return axios
    .post('users/register', {
      first_name: newUser.first_name,
      last_name: newUser.last_name,
      email: newUser.email,
      password: newUser.password
    })
    .then(response => {
      console.log('Registered')
    })
}

export const login = user => {
  console.log(user)
  return axios
    .post('http://localhost:4500/login', {
      user: user.user,
      password: user.password
    })
    .then(response => {
      console.log("Funcion Login -0-",response)

    })
    .catch(err => {
      console.log(err)
      return JSON.stringify({ error: err.response, message:err.response.data.message })
    })
}
